import './styles.css';  

function MainContent() {
  return (
    <div className="main-content">
      <h1>Combien de débit INTERNET ai-je besoin?</h1>
      <p>Dites-nous comment vous utilisez Internet et nous vous recommandons une vitesse Internet appropriée.</p>
      <div className="buttons">
        <button className="btn">Résidentiel</button>
        <button className="btn">Entreprise</button>
      </div>
    </div>
  );
}

export default MainContent;
